function build(i){
	if(i==0||i>build_opts.length) return;

	let b=build_opts[i-1].b()
	stats.money-=b.costs.money
	b.x=player.x+cam.x
	b.y=player.y+cam.y
	builds.push(b)
	if(!!b.on_build) b.on_build()
}

