let panda={
	x:84,y:84,
	flip:0,
	state:"idle",
	update(e){
		if(btnp(6)) this.state="hunt"

		limitXY(this)
		if(!(t%30/15)) return
		switch (this.state) {
			case "hunt":
				var target=animals_alive[0]
				animals_alive.forEach((e,i,arr)=>{
					//TODO:find closest
					if(e.type=="bird") target=e
				})
				if(this.x>target.x) this.x-=rnd(3)
				if(this.x<target.x) this.x+=rnd(3)
				if(this.y>target.y) this.y-=rnd(3)
				if(this.y<target.y) this.y+=rnd(3)
				
				if(target.y<0) this.state="walk"
				break;
			case "walk":
				if((this.x-cam.x)>(player.x)) this.x-=rnd(3)
				if((this.x-cam.x)<(player.x)) this.x+=rnd(3)
				if((this.y-cam.y)>(player.y)) this.y-=rnd(3)
				if((this.y-cam.y)<(player.y)) this.y+=rnd(3)
				if((this.x-cam.x)>(player.x)) this.flip=1
				if((this.x-cam.x)<(player.x)) this.flip=0
				if(Math.abs(this.x-(player.x))<30&&Math.abs(this.y-(player.y))<20) this.state="idle"
			break			
			default:
				if(Math.abs(panda.x-(player.x))>30||Math.abs(panda.y-(player.y))>20) this.state="walk"
				else this.state="idle"
			break;
		}
		
	},
	draw(t){
		if(this.state=="idle") spr((((t%60)/30|0)+34),this.x-cam.x,this.y-cam.y,5,1,this.flip)
		if(this.state=="walk") spr((((t%60)/30|0)+38),this.x-cam.x,this.y-cam.y,5,1,this.flip)
		if(this.state=="hunt") spr((((t%60)/30|0)+38),this.x-cam.x,this.y-cam.y,5,1,this.flip)
		label(this,this.state)		
	}
}

let animals={
	pato:{new(x,y){
		return{
			type:"bird",
			x:x,y:y,
			flip:0,
			state:"idle",
			update(e,i,arr){
				if(this.y<0) arr.splice(i,1)
				if(!(t%60/30)) return
	
				// Should change state?
				if(e.y<21) {e.state="fly"}
				else if(Math.abs(panda.x-e.x)<20&&Math.abs(panda.y-e.y)<15) {e.state="fly"}
				else if(rnd(10)>7) {e.state="walk"}
				else {e.state="idle"}
				
				// Update by state
				switch (e.state) {
					case "fly":
						var v=3
						if(Math.abs(panda.x-e.x)<5)v=5
						if(e.x>panda.x)e.x+=rnd(v)
						if(e.x<panda.x)e.x-=rnd(v)
								
						if(Math.abs(panda.y-e.y)<5)v=5
						if(e.y>panda.y)e.y+=rnd(v)
						if(e.y<=panda.y)e.y-=rnd(v)
								
						if(this.x>234)this.x=234
						if(this.x<-2)this.x=-2
						if(this.y>127)this.y=127
					break;
					case "walk":
						let dx=rnd(3)-1
						let dy=rnd(3)-1
						
						if(dx>0)this.flip=1
						if(dx<0)this.flip=0
						
						this.x+=dx
						this.y+=dy
						limitXY(this)
					break;
					default: e.state="idle"; break;
				}
			},
			draw(e)
			{
				let v=(t%10/5|0)
				switch (e.state) {
					case "idle":spr(v+20,this.x-cam.x,this.y-cam.y,5,1,this.flip);break;
					case "walk":spr(v+18,this.x-cam.x,this.y-cam.y,5,1,this.flip);break;
					case "fly":spr(v+22,this.x-cam.x,this.y-cam.y,5,1,this.flip);break;
				}
				label(this, this.state+" "+v)
			}
		}
	}},
	ovelha:{new(x,y){
		return{
			type:"farm",
			x:x,y:y,
			flip:0,
			state:"idle",
			update(e,i,arr){
				if(this.y<0) arr.splice(i,1)
				if(!(t%60/30)) return
	
				// Should change state?
				if(rnd(10)>7) {e.state="walk"}
				else {e.state="idle"}
				
				// Update by state
				switch (e.state) {
					case "walk":
						let dx=rnd(3)-1
						let dy=rnd(3)-1
						
						if(dx>0)this.flip=1
						if(dx<0)this.flip=0
						
						this.x+=dx
						this.y+=dy
						limitXY(this)
					break;
					default: e.state="idle"; break;
				}
			},
			draw(e)
			{
				let v=(t%10/5|0)
				switch (e.state) {
					case "idle":spr(v+66,this.x-cam.x,this.y-cam.y,5,1,this.flip);break;
					case "walk":spr(v+68,this.x-cam.x,this.y-cam.y,5,1,this.flip);break;
				}
				label(this, this.state+" "+v)
				if(Math.abs(player.x-cam.x-e.x)<10&&Math.abs(player.y-cam.y-e.y)<10){
					ui.d_x_btn(e.x,e.y,"hunt")
					if(btnp(5)) stats.food++
				}

			}
		}
	}}
}

